import React from 'react';

const Logo = () => {
  return (
    <div className="logo-container">
      <img 
        src="/images/logo.png" 
        alt="LaLiga Info Logo" 
        className="logo-image"
      />
      <span className="logo-text">LaLiga Info</span>
    </div>
  );
};

export default Logo;
